import { useState } from 'react';

const CreateProduct = () => {
  const [name, setName] = useState('Wes');
  const [price, setPrice] = useState('Wes');

  return (
    <form>
      <label htmlFor="name">
        <input
          type="text"
          id="name"
          name="name"
          placeholder="name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </label>
      <label htmlFor="price">
        <input
          type="text"
          id="price"
          name="price"
          placeholder="price"
          value={price}
          onChange={(e) => setPrice(e.target.value)}
        />
      </label>
    </form>
  );
};

export default CreateProduct;
